const DEFAULT_ICON_SIZE = 36;

type props = { icon: IconType; size?: number; className?: string };

export const CustomIcon = ({ icon, size, className, ...props }: props) => {
  const Component = ICONS[icon];
  const iconSize = size ?? DEFAULT_ICON_SIZE;
  return (
    <Component
      className={className}
      height={iconSize}
      width={iconSize}
      {...props}
    />
  );
};
